sys_variable_value.value:
(function execute(inputs, outputs) {
  var projects = [];
  if (inputs.statusCode == '200') {
    var payload = JSON.parse(inputs.responseBody);
    for(var i = 0; i < payload.projects.project.length; i++) {
      var project = payload.projects.project[i];
      projects.push({'label': project.name, 'name': project.key});
    }
  } 
  outputs.projects = { data: projects };
})(inputs, outputs);

